Apple prides itself on simplicity and making all of its technology work seamlessly together. You wouldn’t know it from its charging cables.

For example, if you’re lucky enough to have an iPhone, iPad Pro, Apple Watch and a next-generation Mac laptop with the new MagSafe connector, you’ll be using four different connectors to juice up your devices. 

@MarkGurman says it's time for Apple to simplify its range — and he's got a plan to make it happen. Tap the link in bio to see more in our free-to-read tech newsletter, Power On.
